        setIsModalOpen(false);
    }
    return (
        <ModalBackground isOpen={isOpen}>
        <ModalContainer>
            <CloseButton onClick={onClose}>&times;</CloseButton>
            <ModalTitle>모달 타이틀</ModalTitle>
            <ModalContent>모달 내용</ModalContent>
        </ModalContainer>
    </ModalBackground>
    );
}

export default ModalPage;
